const CardView = ({ users, animal, onBtnClick }) => 
  <div>
    <div>
      {animal}
    </div>
    <ul>
      {users.map(user => 
        <li>{user.name.given} + {user.name.surname}</li>
      )}
    </ul>
    <button onClick={e => onBtnClick(e)}>
      Show more
    </button>
  </div>;

export default CardView;
